import { Route, Routes } from "react-router-dom";
import Welcome from "./components/Welcome";
import Products from "./components/Products";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/welcome">
          <Welcome />
        </Route>
        <Route path="expenses" element={<Expenses />} />
        <Route path="/products">
          <Products />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
